B.EK=new A.iW("Juridique","**Informations Juridiques de R\xe9silience**\n\nR\xe9silience est une entreprise innovante, structur\xe9e juridiquement sous la forme d'une **Soci\xe9t\xe9 par Actions Simplifi\xe9e (SAS)**. Ce statut a \xe9t\xe9 choisi pour sa flexibilit\xe9 et sa capacit\xe9 \xe0 s\u2019adapter aux besoins \xe9volutifs de l\u2019entreprise, tout en offrant une gouvernance claire et des responsabilit\xe9s d\xe9finies pour ses associ\xe9s.\n\n---\n\n### **Forme Juridique et Constitution**\nFond\xe9e en 2021, R\xe9silience est constitu\xe9e en tant que **Soci\xe9t\xe9 par Actions Simplifi\xe9e (SAS)**. Ce choix permet \xe0 l\u2019entreprise :\n- De b\xe9n\xe9ficier d'une gestion simplifi\xe9e par rapport \xe0 d'autres formes juridiques.\n- D'offrir une grande libert\xe9 dans la r\xe9daction des statuts.\n- De limiter la responsabilit\xe9 des associ\xe9s au montant de leurs apports.\n\nCe statut est particuli\xe8rement adapt\xe9 aux startups innovantes comme R\xe9silience, car il permet d'accueillir facilement de nouveaux investisseurs et d\u2019adapter la gouvernance en fonction des besoins.\n\n---\n\n### **Structure et Gouvernance**\nR\xe9silience est dirig\xe9e par des personnalit\xe9s exp\xe9riment\xe9es du secteur entrepreneurial et m\xe9dical, assurant une gouvernance solide et orient\xe9e vers l'innovation :\n- **Pr\xe9sidente (2021)** : **C\xe9line Lazorthes**, entrepreneure reconnue pour son expertise en innovation et gestion d\u2019entreprise.\n- **Directeur G\xe9n\xe9ral (2021)** : **Jonathan Benhamou**, sp\xe9cialiste en solutions SaaS et d\xe9veloppement strat\xe9gique.\n\nL\u2019entreprise s\u2019appuie \xe9galement sur deux comit\xe9s consultatifs :\n1. **Comit\xe9 de Surveillance (mandat de 3 ans)** :\n   - **Jonathan Benhamou**\n   - **C\xe9line Lazorthes**\n   - **Raffi Kamber**\n   - **Jeremy Uzan**\n2. **Comit\xe9 de Mission et Comit\xe9 Scientifique** : En cours de structuration pour accompagner les projets strat\xe9giques et les initiatives de recherche.\n\n---\n\n### **Les Associ\xe9s et leurs Contributions**\nR\xe9silience compte **8 associ\xe9s**, dont les apports financiers totalisent **10 000 euros**. Ces apports, bien que modestes, symbolisent l'engagement collectif des fondateurs et partenaires dans ce projet ambitieux.\n\n#### **R\xe9partition des apports :**\n- **C\xe9line Lazorthes** : 1 825 \u20ac\n- **Soci\xe9t\xe9 C\xe9lavi** : 1 825 \u20ac\n- **Jonathan Benhamou** : 3 650 \u20ac\n- **Soci\xe9t\xe9 Suomi Corp** : 46 \u20ac\n- **Thomas Clozel** : 46 \u20ac\n- **Nicolas Helleringer** : 1 848 \u20ac\n- **Matthieu Pozza** : 260 \u20ac\n- **Gustave Roussy Transfert** : 500 \u20ac\n\nChaque associ\xe9 d\xe9tient une part des **1 000 000 d\u2019actions** composant le capital social de R\xe9silience, soulignant leur engagement dans la mission de l\u2019entreprise.\n\n---\n\n### **Responsabilit\xe9 des Associ\xe9s**\nConform\xe9ment au statut de SAS, les associ\xe9s de R\xe9silience b\xe9n\xe9ficient d\u2019une responsabilit\xe9 limit\xe9e. Cela signifie qu\u2019ils ne peuvent \xeatre tenus responsables des dettes de l\u2019entreprise qu\u2019\xe0 hauteur de leur apport initial. Ce cadre juridique offre une protection aux associ\xe9s tout en favorisant la prise de risque pour innover et d\xe9velopper des solutions disruptives.\n\n---\n\n### **Dur\xe9e de la Soci\xe9t\xe9**\nR\xe9silience est constitu\xe9e pour une dur\xe9e de **99 ans**, \xe0 compter de son inscription au registre du commerce et des soci\xe9t\xe9s. Cette dur\xe9e refl\xe8te la vision \xe0 long terme de l\u2019entreprise, qui souhaite \xe9tablir un mod\xe8le durable pour la prise en charge des patients en oncologie.\n\n---\n\n### **Les Statuts de R\xe9silience**\nLes statuts de R\xe9silience d\xe9finissent clairement les r\xe8gles de fonctionnement et de gouvernance de l\u2019entreprise. Ils incluent :\n- Les droits et obligations des associ\xe9s.\n- Les modalit\xe9s de cession des actions pour pr\xe9server l\u2019\xe9quilibre entre les fondateurs et les investisseurs.\n- Les r\xe8gles de prise de d\xe9cision en assembl\xe9e g\xe9n\xe9rale ou en comit\xe9 de surveillance.\n\nCes statuts garantissent un \xe9quilibre entre flexibilit\xe9 et rigueur juridique, essentiel pour une entreprise \xe9voluant dans le secteur de la sant\xe9 num\xe9rique.\n\n---\n\n### **Conclusion**\nGr\xe2ce \xe0 une gouvernance solide, une structure juridique adapt\xe9e et une vision ambitieuse, R\xe9silience est parfaitement positionn\xe9e pour relever les d\xe9fis li\xe9s \xe0 l'innovation en oncologie. Ce cadre juridique offre une base solide pour accueillir de nouveaux partenaires et poursuivre son d\xe9veloppement \xe0 l\u2019\xe9chelle nationale et internationale.\n",B.Ak,null,null)
