B.EM=new A.iW("Histoire","**R\xe9silience : R\xe9inventer l'accompagnement en oncologie**\n\nFond\xe9e en f\xe9vrier 2021, **R\xe9silience** est une entreprise fran\xe7aise innovante sp\xe9cialis\xe9e dans la t\xe9l\xe9surveillance et l'accompagnement des patients atteints de cancer. Gr\xe2ce \xe0 des solutions technologiques avanc\xe9es, elle s'est donn\xe9e pour mission de r\xe9volutionner la prise en charge en oncologie, en mettant le patient au c\u0153ur de ses priorit\xe9s.\n\n---\n\n### **Vision et Mission**\n**R\xe9silience** se distingue par son engagement \xe0 am\xe9liorer la qualit\xe9 de vie des patients gr\xe2ce \xe0 :\n- Une approche centr\xe9e sur le patient, avec un suivi continu et personnalis\xe9.\n- L'utilisation d'algorithmes avanc\xe9s pour analyser les donn\xe9es de sant\xe9 en temps r\xe9el.\n- La cr\xe9ation d'outils innovants pour soutenir les professionnels de sant\xe9 dans leurs d\xe9cisions th\xe9rapeutiques.\n\n**Valeurs cl\xe9s** :\n- **Humilit\xe9** : Travailler avec les patients et professionnels de sant\xe9 avec respect et empathie.\n- **Innovation** : Pousser les limites technologiques pour transformer les soins.\n- **Collaboration** : Favoriser le travail d'\xe9quipe entre les experts m\xe9dicaux, technologiques et patients.\n\n---\n\n### **Les D\xe9buts**\nL'id\xe9e de R\xe9silience est n\xe9e d'une volont\xe9 de **r\xe9duire les in\xe9galit\xe9s d'acc\xe8s aux soins en oncologie**. Les fondateurs, **C\xe9line Lazorthes** et **Jonathan Benhamou**, ont combin\xe9 leurs expertises respectives pour d\xe9velopper une solution novatrice qui :\n- Offre un suivi m\xe9dical continu et adapt\xe9 aux besoins des patients.\n- Am\xe9liore la capacit\xe9 des professionnels de sant\xe9 \xe0 prendre des d\xe9cisions \xe9clair\xe9es.\n\nD\xe8s ses d\xe9buts, R\xe9silience s'est impos\xe9e comme un acteur majeur gr\xe2ce \xe0 sa vision claire et ses solutions technologiques uniques.\n\n---\n\n### **Partenariats Strat\xe9giques**\nD\xe8s sa cr\xe9ation, R\xe9silience a conclu un **partenariat exclusif avec l\u2019Institut Gustave Roussy**, le premier centre de lutte contre le cancer en Europe. Ce partenariat strat\xe9gique a permis \xe0 R\xe9silience de :\n- B\xe9n\xe9ficier de l'expertise m\xe9dicale et scientifique d'un institut de renomm\xe9e mondiale.\n- Valider ses solutions dans un environnement clinique exigeant.\n- Renforcer sa cr\xe9dibilit\xe9 aupr\xe8s des patients et des professionnels de sant\xe9.\n\n---\n\n### **Innovations et Impact**\nR\xe9silience a d\xe9velopp\xe9 deux outils technologiques majeurs :\n1. **Une application mobile pour les patients** :\n   - Permet aux patients de suivre leurs sympt\xf4mes et traitements.\n   - Offre des recommandations personnalis\xe9es pour am\xe9liorer leur bien-\xeatre.\n\n2. **Une plateforme de t\xe9l\xe9surveillance pour les professionnels de sant\xe9** :\n   - Analyse les donn\xe9es des patients en temps r\xe9el gr\xe2ce \xe0 des algorithmes avanc\xe9s.\n   - Alerte les \xe9quipes m\xe9dicales en cas de risques de complications ou de rechutes.\n\n**R\xe9sultats concrets :**\n- R\xe9duction des hospitalisations impr\xe9vues.\n- Am\xe9lioration de la qualit\xe9 de vie des patients et de leur suivi th\xe9rapeutique.\n\nPour en savoir plus, [visitez le site officiel](https://www.resilience.care/solutions).\n\n---\n\n### **Les Fondateurs**\n\n#### **C\xe9line Lazorthes**\n- **Parcours professionnel** :\n   - Fondatrice de [Leetchi](https://www.crunchbase.com/person/celine-lazorthes), une plateforme de cagnotte en ligne, et de [Mangopay](https://www.crunchbase.com/organization/mangopay), une solution de paiement innovante.\n   - Dipl\xf4m\xe9e de l'**EPITA**, elle est reconnue pour son expertise en cr\xe9ation de start-ups technologiques et en strat\xe9gie digitale.\n- **R\xf4le chez R\xe9silience** : En tant que co-fondatrice et co-CEO, elle apporte une vision entrepreneuriale et une expertise en innovation.\n\n#### **Jonathan Benhamou**\n- **Parcours professionnel** :\n   - Co-fondateur de [PeopleDoc](https://www.linkedin.com/in/jonathan-benhamou-details/experience/), une solution SaaS de gestion des ressources humaines.\n   - Dipl\xf4m\xe9 de l'**HEC Paris**, il est sp\xe9cialis\xe9 dans le d\xe9veloppement strat\xe9gique et op\xe9rationnel de logiciels.\n- **R\xf4le chez R\xe9silience** : En tant que co-fondateur et co-CEO, il joue un r\xf4le cl\xe9 dans la strat\xe9gie et le d\xe9ploiement des solutions technologiques de R\xe9silience.\n\n**Vision commune des fondateurs :**\nC\xe9line et Jonathan ont uni leurs forces pour cr\xe9er une entreprise \xe0 l'intersection de la technologie, de la sant\xe9 et de l'innovation. Leur expertise combin\xe9e positionne R\xe9silience comme un acteur incontournable dans le domaine de l\u2019oncologie num\xe9rique.\n\n---\n\n### **Conclusion**\nAvec une vision ambitieuse, des partenariats solides et une expertise technologique de pointe, R\xe9silience s'est rapidement impos\xe9e comme un leader de l'innovation en oncologie num\xe9rique. L'entreprise continue de transformer la prise en charge des patients, pla\xe7ant la technologie au service de la sant\xe9 et du bien-\xeatre.\n",B.Al,"assets/tete.png",null)
