B.EN=new A.iW("Financement","**Strat\xe9gie de Financement de R\xe9silience**\n\nDepuis sa cr\xe9ation, R\xe9silience a mobilis\xe9 des financements importants pour concr\xe9tiser ses ambitions et devenir un leader dans la t\xe9l\xe9surveillance m\xe9dicale. Ces lev\xe9es de fonds t\xe9moignent de la confiance des investisseurs dans le potentiel de l\u2019entreprise.\n\n---\n\n### **Phases de financement**\n\n#### **1. Financement d\u2019amor\xe7age (Mars 2021)**\nR\xe9silience a lev\xe9 **5 millions d\u2019euros** lors de son financement d\u2019amor\xe7age. Cette premi\xe8re phase a permis :\n- De lancer les activit\xe9s initiales.\n- De d\xe9velopper les premi\xe8res versions de son application et de sa plateforme de t\xe9l\xe9surveillance.\n- De poser les bases de partenariats strat\xe9giques, notamment avec l\u2019Institut Gustave Roussy.\n\n#### **2. S\xe9rie A (Janvier 2022)**\nEn phase de croissance, R\xe9silience a lev\xe9 **40 millions d\u2019euros**. Ce financement significatif a marqu\xe9 une \xe9tape cruciale dans le d\xe9veloppement de l\u2019entreprise. Les fonds ont \xe9t\xe9 utilis\xe9s pour :\n- \xc9tendre les solutions technologiques de R\xe9silience.\n- Accro\xeetre sa visibilit\xe9 sur le march\xe9 fran\xe7ais.\n- Renforcer son infrastructure et son \xe9quipe.\n\n#### **3. S\xe9rie B (2023)**\nAvec **25 millions de dollars** lev\xe9s, men\xe9s par **Picus Capital** et **Red River West**, R\xe9silience s\u2019est concentr\xe9e sur son d\xe9veloppement international. Ce tour de table a permis de :\n- Pr\xe9parer l\u2019expansion en Belgique et en Allemagne.\n- Diversifier les solutions pour inclure d\u2019autres pathologies chroniques.\n\n---\n\n### **Utilisation des fonds lev\xe9s**\n\nLes capitaux lev\xe9s par R\xe9silience ont \xe9t\xe9 strat\xe9giquement allou\xe9s pour maximiser leur impact sur les objectifs de l\u2019entreprise. Voici les principaux axes d\u2019investissement :\n\n1. **Expansion internationale**\n   - D\xe9ploiement des solutions R\xe9silience en Europe, en commen\xe7ant par la Belgique et l'Allemagne.\n   - \xc9tablissement de collaborations avec des institutions m\xe9dicales internationales.\n\n2. **Diversification des offres**\n   - D\xe9veloppement de solutions adapt\xe9es \xe0 d\u2019autres pathologies, comme les maladies inflammatoires chroniques de l\u2019intestin.\n   - Conception de nouveaux outils technologiques pour r\xe9pondre \xe0 des besoins diversifi\xe9s.\n\n3. **Innovation et essais cliniques**\n   - Acc\xe9l\xe9ration des essais cliniques pour valider les solutions en conditions r\xe9elles.\n   - Renforcement des collaborations avec des laboratoires pharmaceutiques et des centres de recherche.\n\n4. **Recrutement et d\xe9veloppement organisationnel**\n   - R\xe9silience pr\xe9voit de recruter entre **50 et 100 nouveaux collaborateurs** dans les 18 prochains mois, renfor\xe7ant ainsi ses \xe9quipes techniques, m\xe9dicales et commerciales.\n   - Structuration interne pour soutenir une croissance rapide et durable.\n\n---\n\n### **Impact des financements**\n\nGr\xe2ce \xe0 ces financements, R\xe9silience a su :\n- D\xe9velopper une infrastructure robuste pour la t\xe9l\xe9surveillance m\xe9dicale.\n- S\u2019imposer comme un acteur cl\xe9 de l\u2019oncologie num\xe9rique en France.\n- Poser les bases pour devenir un leader europ\xe9en, voire mondial, dans la prise en charge des maladies chroniques gr\xe2ce \xe0 la technologie.\n\nLes fonds lev\xe9s ont permis \xe0 R\xe9silience de transformer sa vision en r\xe9alit\xe9, tout en r\xe9pondant aux d\xe9fis croissants du secteur de la sant\xe9. L\u2019entreprise continue de mobiliser des ressources pour innover et \xe9tendre son impact \xe0 une \xe9chelle internationale.\n",B.Am,null,null)
