B.EO=new A.iW("Fiscal","**R\xe9gime Fiscal et Social de R\xe9silience**\n\nEn tant que Soci\xe9t\xe9 par Actions Simplifi\xe9e (SAS), R\xe9silience est soumise \xe0 un cadre fiscal et social sp\xe9cifique, offrant \xe0 la fois des obligations et des opportunit\xe9s d\u2019optimisation.\n\n---\n\n### **Imp\xf4ts et Taxes**\n\n1. **Imp\xf4t sur les Soci\xe9t\xe9s (IS)** :\n   - R\xe9silience est soumise \xe0 l'**Imp\xf4t sur les Soci\xe9t\xe9s (IS)**, avec un taux de **25%** en 2024 pour les entreprises dont le chiffre d'affaires est inf\xe9rieur \xe0 250 millions d'euros.\n   - Ce r\xe9gime fiscal permet de d\xe9duire certaines d\xe9penses, telles que les frais de recherche et d\xe9veloppement, ce qui est particuli\xe8rement avantageux pour une entreprise innovante comme R\xe9silience.\n\n2. **Cotisation Fonci\xe8re des Entreprises (CFE)** :\n   - La CFE est une taxe locale bas\xe9e sur la valeur locative des biens immobiliers utilis\xe9s pour les activit\xe9s professionnelles.\n   - R\xe9silience, en tant qu\u2019entreprise op\xe9rant dans le num\xe9rique, b\xe9n\xe9ficie d\u2019une base taxable relativement limit\xe9e.\n\n3. **Taxe sur la Valeur Ajout\xe9e (TVA)** :\n   - R\xe9silience collecte la TVA sur ses ventes de services et peut r\xe9cup\xe9rer la TVA pay\xe9e sur ses achats professionnels.\n   - Ce m\xe9canisme est essentiel pour optimiser la tr\xe9sorerie de l\u2019entreprise.\n\n**Impact attendu :**\nCes obligations fiscales sont bien adapt\xe9es aux besoins de R\xe9silience et permettent une gestion efficace de ses finances, tout en favorisant l\u2019investissement dans l\u2019innovation.\n\n---\n\n### **Exon\xe9rations et R\xe9ductions Fiscales**\n\n1. **Statut de Jeune Entreprise Innovante (JEI)** :\n   - R\xe9silience b\xe9n\xe9ficie du statut de **Jeune Entreprise Innovante (JEI)**, qui permet :\n     - Une exon\xe9ration totale ou partielle des charges sociales patronales sur les emplois li\xe9s \xe0 la recherche.\n     - Une exon\xe9ration temporaire d'imp\xf4ts sur les b\xe9n\xe9fices.\n\n2. **Cr\xe9dit d'Imp\xf4t Recherche (CIR)** :\n   - Le CIR permet \xe0 R\xe9silience de r\xe9cup\xe9rer jusqu'\xe0 **30% des d\xe9penses engag\xe9es en recherche et d\xe9veloppement**.\n   - Les d\xe9penses \xe9ligibles incluent le d\xe9veloppement des algorithmes, les tests cliniques et les prototypes de la plateforme num\xe9rique.\n\n3. **Cr\xe9dit d'Imp\xf4t Innovation (CII)** :\n   - Destin\xe9 aux PME, le CII soutient l\u2019effort d\u2019innovation de R\xe9silience pour d\xe9velopper des solutions novatrices comme l\u2019application mobile et la t\xe9l\xe9surveillance.\n\n**Impact attendu :**\nCes dispositifs fiscaux permettent \xe0 R\xe9silience d\u2019all\xe9ger ses charges et d\u2019investir davantage dans la recherche et l\u2019innovation, consolidant ainsi sa position de leader dans l\u2019oncologie num\xe9rique.\n\n---\n\n### **R\xe9gime Social des Dirigeants**\n\n1. **Assimil\xe9 salari\xe9** :\n   - En tant que SAS, les dirigeants de R\xe9silience (pr\xe9sident et directeur g\xe9n\xe9ral) sont assimil\xe9s salari\xe9s.\n   - Ils b\xe9n\xe9ficient du **r\xe9gime g\xe9n\xe9ral de la s\xe9curit\xe9 sociale**, offrant une couverture compl\xe8te en mati\xe8re de maladie, retraite et pr\xe9voyance.\n\n2. **Charges sociales** :\n   - Les charges sociales pour les dirigeants repr\xe9sentent environ **65% du salaire net**, un co\xfbt \xe9lev\xe9 mais justifi\xe9 par la qualit\xe9 de la protection sociale.\n\n3. **Arbitrage entre salaire et dividendes** :\n   - Les dirigeants peuvent opter pour une combinaison de :\n     - **Salaire** : Soumis aux cotisations sociales mais offrant une s\xe9curit\xe9 sociale \xe9tendue.\n     - **Dividendes** : Soumis \xe0 une flat tax de **30%**, permettant de r\xe9duire les charges sociales.\n\n**Impact attendu :**\nCette flexibilit\xe9 permet aux dirigeants de R\xe9silience d\u2019optimiser leur r\xe9mun\xe9ration tout en maintenant une protection sociale ad\xe9quate.\n\n---\n\n### **Conclusion**\n\nLe cadre fiscal et social de R\xe9silience est con\xe7u pour r\xe9pondre aux besoins d\u2019une startup innovante dans le domaine de la sant\xe9 num\xe9rique. Gr\xe2ce aux exon\xe9rations fiscales et aux cr\xe9dits d\u2019imp\xf4t, l\u2019entreprise peut concentrer ses ressources sur ses projets d\u2019innovation et de croissance, tout en respectant ses obligations fiscales et sociales. Ce mod\xe8le soutient le d\xe9veloppement durable de R\xe9silience et renforce sa comp\xe9titivit\xe9 sur le march\xe9.\n",B.Ah,null,null)
